import React, { Component } from "react";

class BlogList extends Component {
    render () {
        const blogs = this.props.blogs;
        return (
            blogs.map(blog => (
            <ul>
                <li>{blog.title}</li>
                <li>{blog.text}</li>
            </ul>
            ))
        );
    }
}
export default BlogList;
